import {ResponsiveContainer,ComposedChart,Line,XAxis,YAxis,Legend,Tooltip,CartesianGrid ,Area,B} from "recharts";

var data =[
  {
    name:"00:00",
    Time:0,
    fee:3,

  },
  {
    name:"02:00",
    Time:2,
    fee:6,

  },
  {
    name:"04:00",
    Time:4,
    fee:9,

  },
  {
    name:"06:00",
    Time:10,
    fee:8,

  },
  {
    name:"08:00",
    Time:8,
    fee:10,

  },
  {
    name:"10:00",
    Time:10,
    fee:10,

  },


];

const LineGraph = () => {
  return ( 
    <>
     <ComposedChart width={730} height={250} data={data}>
  <XAxis dataKey="name" />
  <YAxis />
  <Tooltip />
  <Legend />
  <CartesianGrid stroke="#f5f5f5" />
  <Area type="monotone" dataKey="amt" fill="#8884d8" stroke="#8884d8" />
  <Bar dataKey="pv" barSize={20} fill="#413ea0" />
  <Line type="monotone" dataKey="uv" stroke="#ff7300" />
</ComposedChart>
    </>
   );
}

export default LineGraph;
